3️⃣...2️⃣... 1️⃣... Y ya está acá el #MegaSorteo #MimemosaMamá!!!
👩👩‍🦱👵👩‍🦲
Con el mes de #mayo a las puertas y con el objetivo de homenajear a mamá en su día, nos hemos unido 130 emprendimientos para dar 15 #MegaRegalazos
📆🎁❤️
Estamos convencidxs de que no hay que esperar una fecha señalada en el calendario para decirles a nuestras mamás cuánto las amamos, pero estas fechas lo ameritan, porque las mamis son esas personitas que cuidan de uno por lo general más que a ellas mismas, consienten, son amigas, confidentes, pero también necesitan mimos.
⁉️⁉️⁉️
¿Qué hacer para participar? 
 ¡Pues acá te va!!!
👇👇👇👇👇👇

